import React from 'react';
import './App.css';
// import Register from './Register';
import FFheader from './FFheader';
import '../src/FFheader.css';
import '../src/FFabout.css';
import '../src/FFservice.css';
import '../src/FFtrainer.css';
import '../src/FFfooter.css';
import FFabout from './FFabout';
import FFservice from './FFservice';
import FFtrainer from './FFtrainer';
import FFfooter from './FFfooter';
import { Switch,Route } from "react-router-dom";



const App = () => {
  return (
    <Switch>
      <Route path="/">
      <FFheader/>
      </Route>

      <Route path="/">
      <FFabout/>
      </Route>

      <Route path="/">
      <FFservice/>
      </Route>

      <Route path="/">
      <FFtrainer/>
      </Route>

      <Route path="/">
      <Ffooter/>
      </Route>

    </Switch>

  );
}

export default App;
